import { TextField } from "@mui/material";

export default function GenericInputField(props) {
  const { label, helperText } = props;
  return (
    <TextField
      error={true}
      id="FirstName"
      label="First Name"
      variant="outlined"
      helperText="Field should accept only alphabetical characters"
    />
  );
}
